import React from "react";
import logo from '../img/logo_veelo.png';
import '../css/Header.css';


class Header_Navbar extends React.Component{
    constructor(props){
        super(props);


    }

    render() {
        return (
            <div className="row">
                <div className="logo">
                    <a className="navbar-brand" href="#">
                        <img src={logo} style={{height: 50}}/>
                    </a>
                </div>
                <h1 className="selectItem">
                    <p style={{color: "white"}}>Acceuil</p>
                </h1>
                <h3 className="notSelectItem">
                    <p style={{color: "white"}}>Administration</p>
                </h3>
            </div>
        )
    }

}

export default Header_Navbar;
